import React from "react";

function Gallery() {
    return (
        <div>
            <Navbar />
            <div className="container">
                <h1>Welcome to My Gallery</h1>
                <p>This is a paragraph.</p>
            </div>
            <Footer />
        </div>
    );
}

export default Gallery;
